import { useState } from "react";

function App() {

  const [counter , setCounter ] = useState(1)

  const handleClick = () => {
    setCounter(counter + 1)
  }

  return (
    <div className="App">
      <h1>{counter}</h1>
      <button onClick={handleClick}>click</button>
    </div>
  );
}

export default App;
